import { Link } from 'react-router-dom'

const Image = (imageUrl) => {
    return (
        <div className="member-img portfolio-item">
            <Link to="/product/id">
                <img src="https://nikulden.com/image/cache/data/0002.Jakson/kanade/CGR-800x800.jpg" className="img-fluid productImage" style="productImage" alt="Product image" />
            </Link>
        </div>
    )
}

export default Image;
